function signUpValidation(values) {
  let errors = {
    noUppercaseChar: "",
    noNumericalChar: "",
    noSpecialChar: "",
    badLength: "",
    isEmptyPass: "",
    isEmptyEmail: "",
    improperEmail: "",
    noFirstname: "",
    noLastname: "",
  };

  const emailPattern = /^[a-zA-Z0-9_.-]+@[a-zA-Z]+\.[a-zA-Z]$/;

  if (values.email === "") {
    errors.isEmptyEmail = true;
  }
  if (!emailPattern.test(values.email)) {
    errors.improperEmail = true;
  }

  return errors;
}

export default signUpValidation;
